import React, { useState } from 'react';

//UseEffect hook is used to make any manipulation on the page after when the render function works.
function Effect() {
    const [cnt, setCnt] = useState(0);

    return (
        <div>
            <button>Count {setCnt()}</button>
        </div>
    )
}

export default Effect;
